"""
A solution to a ROSALIND bioinformatics problem.
Problem Title: Compute the 2-Break Distance Between a Pair of Genomes
Rosalind ID: BA6C
URL: http://rosalind.info/problems/ba6c/
"""
def blocks(p):
    elements=0
    for c in p:
        elements=elements+len(c)
    return elements

def ChromosomeToCycle(Chromosome):
    Nodes=[]
    for j in range(0,len(Chromosome)):
        i=Chromosome[j]
        if i > 0:
            Nodes.append(2*i-1)
            Nodes.append(2*i)
        else:
            Nodes.append(-2*i) #minus because i is negative
            Nodes.append(-2*i-1)
    return Nodes

def ColoredEdges(P):
    Edges = []
    for Chromosome in P:
        Nodes = ChromosomeToCycle(Chromosome)
        for j in range(len(Chromosome)):
            Edges.append((Nodes[2 * j + 1], Nodes[(2 * j + 2) % len(Nodes)]))
    return Edges

def cycles(p,q):
    e=ColoredEdges(p)
    e.extend(ColoredEdges(q))
    c=0
    nodes=[]
    for i in range (2*blocks(p)):
        nodes.append(i)
    while len(e)>0:
        first=e[0][0]
        second=e[0][1]
        e.remove(e[0])
        while second!=first:
            for edge in e:
                if edge[0]==second:
                    second=edge[1]
                    e.remove(edge)
                    break
                if edge[1]==second:
                    second = edge[0]
                    e.remove(edge)
                    break
        c=c+1
    return c

